import './home.css';
function Home(){
    return (
        <>
        <div className='home-box'>
            <div className='about'>
                <h1>Hii ....Anuj Singh Rana</h1>
                <h2>Web Devloper</h2>
            </div>
        </div>
        </>
    );
}
export default Home;
